//import Link from 'next/link';
import React from 'react';
import styled from 'styled-components'
import HeadInner from './Head'
import { NavLink } from 'react-router-dom';



const Ul = styled.ul`

  li a:hover{
      color:#62CBE7;
  }

  @media (max-width: 968px) {
      .navbar{
        display:flex;
        flex-flow: column nowrap;
        gap:8rem;
        height: 0;
      }
      ul{
      flex-flow: column nowrap;
      padding-top:5rem;
      font-size:1.4rem;
      position: relative;
      justify-content:center;
      align-items:center;
      x-index: 1;
      
      }
      .robert-logo{
        display: none;
      }
      .nav-social{
        margin-top:5rem;
        font-size: 1.8rem;
      }
      .line-social{
          display:block;
          height: 8rem;
      }

    
    background-color: #212529;
    position: fixed;
    transform: ${({ open }) => open ? 'translateX(0)' : 'translateX(100%)'};
    top: 0;
    right: 0;
    height: 100vh;
    width: 300px;
    padding-top: 5rem;
    transition: transform 0.3s ease-in-out;

    li {
      color: #fff;
      
    }
  }
`;


const RightNav = ({ open }) => {

  return (
    <Ul open={open}>
    <HeadInner/>

        <div className="navbar">

          <div className="logo-navbar">
              <img src="/robertlogo.png" alt=".robert" className="robert-logo"/>
            </div>


          <div className="page-navbar">
              <ul className="nav-list">
                <li className="nav-item">
                  <NavLink  to='/' activeClassName="active"><i className="fas fa-home"></i></NavLink>
                </li>

                <li className="nav-item">
                  <NavLink  to='/work' activeClassName=""><i className="fas fa-laptop-code"></i></NavLink>
                </li>

                <li className="nav-item">
                  <NavLink to='/about' activeClassName="active"><i className="fas fa-info-circle"></i></NavLink>
                </li>
              </ul>
            </div>

          <div className="social-navbar">
          <ul className="nav-social">
              <li className="nav-social-item">
                <Link  href='https://github.com/robertmoscaliuc96'><i className="fab fa-github"></i></Link>
              </li>

              <li className="nav-social-item">
                <Link  href='https://www.linkedin.com/in/robertmoscalir243004/'><i className="fab fa-linkedin-in"></i></Link>
              </li>
              <li>
                <div className="line-social"></div>
              </li>
            </ul>
          </div>
        </div>
    </Ul>
  )
}

export default RightNav
